import React from 'react'
import { render } from 'react-dom'
import Note from './components/Note'


class App extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            notes: props.notes
        }
    }

    render() {
        return (
            <div>
                <h1>Muistiinpanot</h1>
                <ul>
                    {this.state.notes.map(note => <Note key={note.id} note={note} />)}
                </ul>
            </div>
        )
    }
}   

export default App
